    components:
    - type: MetaData
      desc: Отдыхает с шиком, сражается – без страха. "Рейдж" - позывной первого нетраннера группы Arrows, не только мастер боя, но и королева пляжа! Узкий купальник и безупречная форма лишь доказывает, что боец может быть обаятельным и смертоностным одновременно.
