- proto: PosterContrabandEnlistGorlex
  entities:
  - uid: 1041
    components:
    - type: MetaData
      desc: Красочная картина городского боя на которой неорганизованная лавина разумных существ с ножами, палками и пистолетами рвётся на позиции бравых бойцов, отстреливающихся из за укрытий в боевой броне "рейдер" чёрного цвета с зелёными повязками на плече каждого.
      name: Отбросим их назад!
    - type: Transform
      pos: 4.5,12.5
      parent: 2
