    components:
    - type: MetaData
      desc: Никогда не забывай проверять работоспособность корабля! Любая, даже самая маленькая поломка может привести к серьёзным последствиям. Если выпала свободная минута, то не ленись, а проверяй функциональность корабля.
    - type: Transform
