    components:
    - type: MetaData
      desc: Вся доска увешана различными листками. Графики дежурств, приёма пищи, сна, проверки всевозможных систем корабля. За этими листками можно увидеть часть изображения какого то шаттла и обрывки технических характеристик с пометками, которые невозможно разобрать из за свежего слоя бумаг.
